import { Component, Injector, Input } from '@angular/core';
import { ImageProcessorUtil } from '@core/util/image-processor.util';
import { SharedComponent } from '@shared/component/common/shared.component';

/**
 * @author Do Quoc Viet
 */

@Component({
  selector: 'moc-image',
  templateUrl: 'image.component.html',
  styleUrls: ['image.component.scss']
})
export class ImageComponent extends SharedComponent {
  @Input() mocSrc: string;
  @Input() mocId: string;
  @Input() mocDisplayName: string;
  @Input() mocWidth: number;
  @Input() mocHeight: number;
  @Input() mocFontSize: string;
  @Input() mocCanUploadImage: boolean = false;

  constructor(
    injector: Injector
  ) {
    super(injector);
    this.mocSrc = 'data:image/png;base64,';
  }

  protected readonly ImageProcessorUtil = ImageProcessorUtil;
}
